import React, { useState } from 'react';
import Header from './Header';

const Cart = () => {
  return (
    <div>
      <h1 className="route-title">Shopping Cart</h1>
      <div className="item-count-display">Item count</div>
      <div className="header">
        <Header />
      </div>
    </div>
  );
};

export default Cart;
